import React from 'react'
import background from '../layout/background.jpeg'
import ekko from '../layout/ekko.png'
const Portfolio = () => {
    return (
        <div className ="grid-2 bg-dark">
            <img
                src={background}
                style={{width: '600px', margin: 'auto', display: 'flex'}}
                alt = 'Piece 1'
            />
        </div>  
    )
}

export default Portfolio
